__NUXT_JSONP__("/drugs/Anti-MetEGFR_Monoclonal_Antibody_LY3164530", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A monoclonal antibody (MoAb) against human epidermal growth factor receptor (EGFR) and human hepatocyte growth factor receptor (HGFR or c-Met), with potential antineoplastic activity. Upon administration, anti-Met\u002FEGFR MoAb LY3164530 targets and prevents the activation of EGFR and c-Met. This leads to a downstream inhibition of EGFR\u002Fc-Met-mediated signal transduction pathways, and prevents cellular proliferation in tumor cells overexpressing EGFR and c-Met. EGFR, a member of the epidermal growth factor family of extracellular protein ligands, may be overexpressed on the cell surface of various solid tumor cell types. c-Met, a receptor tyrosine kinase overexpressed or mutated in many tumor cell types, plays a key role in cancer cell growth, survival, angiogenesis, invasion, and metastasis.",fdaUniiCode:"K85WE44TZ7",identifier:"C118281",preferredName:c,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C129822","C20401"],synonyms:[c,"LY-3164530","LY3164530"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAnti-MetEGFR_Monoclonal_Antibody_LY3164530",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Anti-MetEGFR_Monoclonal_Antibody_LY3164530","Anti-Met\u002FEGFR Monoclonal Antibody LY3164530","2021-10-30T13:19:38.133Z")));